def load_Llam_2_13():
    # Charger le tokenizer
    tokenizer = AutoTokenizer.from_pretrained("meta-llama/Llama-2-13b-hf")

    # Charger le mod√®le en 4 bits
    model = AutoModelForCausalLM.from_pretrained(
        "meta-llama/Llama-2-13b-hf",
        load_in_4bit=True,  # Charger le mod√®le en 4 bits
        device_map="auto",  # Pour r√©partir automatiquement le mod√®le sur les GPU disponibles
    )

    # Sauvegarde en local
    model_path='./Llama-2-13b-hf'

    tokenizer.save_pretrained(model_path)
    model.save_pretrained(model_path)
    print(f"‚úÖ Mod√®le et tokenizer charg√©s localement depuis : {model_path}")

    return model, tokenizer

def load_Llam_2_13_from_local():

    # Charger depuis un autre r√©pertoire
    model_path="./Llama-2-13b-hf"

    tokenizer = AutoTokenizer.from_pretrained(model_path)
    model = AutoModelForCausalLM.from_pretrained(model_path, load_in_4bit=True)# Charger depuis un autre r√©pertoire

    print(f"‚úÖ Mod√®le et tokenizer charg√©s localement depuis : {model_path}")

    return model, tokenizer

def simple_test(model, tokenizer):
    # Exemple de texte √† tester
    input_text = "Once upon a time, in a land far, far away,"

    # Tokenizer le texte d'entr√©e
    inputs = tokenizer(input_text, return_tensors="pt").to(model.device)

    # G√©n√©rer une r√©ponse √† partir du mod√®le
    outputs = model.generate(inputs['input_ids'], max_length=100, num_return_sequences=1)

    # D√©coder et afficher le texte g√©n√©r√©
    generated_text = tokenizer.decode(outputs[0], skip_special_tokens=True)
    print('question : ', input_text)
    print('reponse : ', generated_text)

def test_processus(html_content):

    # Extraire uniquement le texte √† partir du HTML
    soup = BeautifulSoup(html_content, "html.parser")
    text_content = soup.get_text(separator=' ')

    # Prompt
    prompt = f"""
                Voici du texte brut extrait d'une page HTML.  sans r√©f√©rences √† l‚Äôauteur, la date, ni aucune image ?

                Texte :
                {text_content}
            """

    # Tokenization
    inputs = tokenizer(prompt, return_tensors="pt").to("cuda")

    # G√©n√©ration
    output = model.generate(inputs['input_ids'], max_new_tokens=1500, temperature=0.2, do_sample=True)

    # D√©codage
    response = tokenizer.decode(output[0], skip_special_tokens=True)


    print('Response processus : ', response)

